const removeItem = ()=> {
    localStorage.removeItem('email');
    localStorage.removeItem('pass');
    localStorage.removeItem('exp');
    localStorage.removeItem('stream');
    localStorage.removeItem('link');
}


const adSuccess = (() => {
    /* */

    const queryString = window.location.search;
    const urlParams = new URLSearchParams(queryString);

    const ad = urlParams.get('ad');


    let imgDOM = document.querySelector('.card-img-top');
    let emailDOM = document.querySelector('#email_card');
    let passDOM = document.querySelector('#pass_card');
    let expDOM = document.querySelector('#exp_card');

    /* */
    let email = localStorage.getItem('email');
    let pass = localStorage.getItem('pass');
    let exp = localStorage.getItem('exp');
    let stream = localStorage.getItem('stream');
    let link = localStorage.getItem('link');
    

    if(ad != null && link == 'true'){
        
        imgDOM.src = `img/${stream}.png`;
        emailDOM.innerText = email;
        passDOM.innerText = pass;
        expDOM.innerText = exp;

        emailDOM.scrollIntoView();

        removeItem();
    }

})();


const redirect = (() => {
    /* */
    const queryString = window.location.search;
    const urlParams = new URLSearchParams(queryString);

    let go = urlParams.get('go');

    if(go != null){

        go = go.split(/(\w\w)/g)
        .filter(p => !!p)
        .map(c => String.fromCharCode(parseInt(c, 16)))
        .join("");

        window.location.replace(go);

        localStorage.setItem('link','true');
    }

  
})();

